        headers: {
          Authorization: `Token ${token}` // Устанавливаем заголовок авторизации с токеном
        }
      })
      .then(res => {
        console.log('Данные успешно получены:', res.data); // Вывод полученных данных в консоль
        this.setState({
          details: res.data,
        });
      })
      .catch(err => {
        console.error('Ошибка при получении данных:', err); // Вывод ошибки в консоль
      });
    }
  }*/
  componentDidMount(){
    let data;
    axios.get('http://127.0.0.1:8000/v1/main/secretary/profile/')
    .then(res => {
      data=res.data;
      this.setState({
        details: data
      });
      console.log(details)
    })
    .catch(err=> {
      console.log(err)
    }

    )
  }

  render() {
    const { details } = this.state;
    return (
      <BasePage isAuthenticated={true} data={details}>
        <Search />
        <ProfileBlocksSecretary secretaryData={details}/>
      </BasePage>
    );
  }
}

export default ProfileSecretary;
